WITH foo AS (
     SELECT a.nombre_capa, b.mapa AS nombre_estilo, a.type, a.definicion, a.label
     FROM elle._map_style a JOIN elle._map b ON a.nombre_capa = b.nombre_capa
     WHERE a.nombre_estilo = 'SIXHIARA' AND b.mapa IN ('BDD_Cartografia_Base', 'BDD_Cartografia_Base_ARA', 'BDD_Inventario')
)
INSERT INTO elle._map_style (nombre_capa, nombre_estilo, type, definicion, label)
SELECT nombre_capa, nombre_estilo, type, definicion, label
FROM foo;

COMMIT;


